/*Table structure for table `csec_child` */

DROP TABLE IF EXISTS `csec_child`;

CREATE TABLE `csec_child` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT 'Record ID',
  `fk_consent` int DEFAULT NULL,
  `interview_date` date DEFAULT NULL COMMENT 'Date of Identification',
  `child_support_other` varchar(5) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Is the child enlisted for support with other organisations',
  `child_support_org` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Name of organisation',
  `child_support_service` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT 'Child service',
  `child_name` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Child name',
  `gender` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `dob` date DEFAULT NULL,
  `age` int DEFAULT NULL COMMENT 'Age in years',
  `disability` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'If disabled differently',
  `school_name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'School Name',
  `child_educ_level` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Level of Education',
  `class` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Class/Form',
  `country` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Country',
  `sub_county` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Sub County',
  `location` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Location/Village',
  `landmark` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Nearby landmark',
  `landmark_name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `child_school_attendance` int DEFAULT NULL COMMENT 'Child school attendance in the last 6-12 months',
  `not_regular_reason` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT 'If not regular , give reasons',
  `meal_per_day` int DEFAULT NULL COMMENT 'Meals family have per day',
  `child_chronic_ill` varchar(5) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'child chronic illness',
  `child_chronic_ill_spec` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Family member chronic illness',
  `fmember_chronic_ill` varchar(5) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Family member with chronic illness',
  `fmember_chronic_ill_spec` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `parent_alive` varchar(5) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Are both parents alive',
  `who_alive` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `stay_together` varchar(5) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `fwife_number` int DEFAULT NULL COMMENT 'How many wifes does your father have',
  `child_live_with` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Who does the child live with',
  `sibling_no` int DEFAULT NULL COMMENT 'How many siblings do you have',
  `sibling_order_9_15` int DEFAULT NULL,
  `sibling_order_16_20` int DEFAULT NULL COMMENT 'Order of siblings from oldest to youngest',
  `sibling_order_21_25` int DEFAULT NULL,
  `sibling_order_26_30` int DEFAULT NULL,
  `sibling_order_31_35` int DEFAULT NULL,
  `sibling_order_35_above` int DEFAULT NULL,
  `father_name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `father_contact` int DEFAULT NULL,
  `mother_name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `mother_contact` int DEFAULT NULL,
  `caregiver_name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `caregiver_contact` int DEFAULT NULL,
  `other_name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `other_name_contact` int DEFAULT NULL,
  `fmember_income_no` int DEFAULT NULL COMMENT 'Family members over 18 years access to income',
  `income_regularity` int DEFAULT NULL COMMENT 'Regularity of income',
  `household_indebt` int DEFAULT NULL COMMENT 'Household present indebtness to meet basic needs',
  `household_assets` int DEFAULT NULL COMMENT 'Household acess to natural resources',
  `household_tools` int DEFAULT NULL COMMENT 'Household tools and infrastructure',
  `hhold_educ_level` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Level of education',
  `sex_exploit` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT 'Nature of sexual exploitaion',
  `exploit_happen_when` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'When exploitaion happened',
  `exploit_continue` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Is it continuing',
  `exploit_month` int DEFAULT NULL,
  `exploit_year` int DEFAULT NULL,
  `exploit_reported` int DEFAULT NULL COMMENT 'Has exploitaion been reported',
  `exploit_reported_to` int DEFAULT NULL COMMENT 'Exploit reported to who',
  `exploit_rpt_to_spec` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci,
  `exploit_notreported_reason` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT 'Why child didnt report case to anyone',
  `other_detail` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT 'Other details noted during interview',
  `child_init` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `caregiver_interview_name` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `caregiver_interview_contact` int DEFAULT NULL COMMENT 'Contact of caregiver',
  `caregiver_interview_date` date DEFAULT NULL COMMENT 'Date caregiver gave information',
  `kesho_staff_name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Kesho Kenya child protection staff detail',
